self.isMock = false;

function cm_mapToken(token, key) {
  IGTMediaElements.getCurrentTokenValue(token).then(e => {
    if (e.token == undefined || e.token.value == undefined) return;
    cm_me[key] = e.token.value;
  });
  IGTMediaElements.subscribeToken(token, function (value) {
    if (value == undefined) return;
    cm_me[key] = value;
  });
}

var callbacks = {};
function cm_watch(key, cb) {
  if (!callbacks[key]) {
    callbacks[key] = [];
  }
  callbacks[key].push(cb);
  return function () {
    var listeners = callbacks[key];
    if (listeners && listeners.length && listeners.length > 0) {
      let idx = listeners.indexOf(cb);
      if (idx != -1) {
        listeners.splice(idx, 1);
      }
    }
  };
}

self.cm_me = new Proxy(self, {
  set: function (target, prop, value) {
    var oldValue = target[prop];
    if (value == oldValue) return true;
    var result = Reflect.set(...arguments);
    var arr = callbacks[prop];
    if (arr && arr.length && arr.length > 0 && target[prop] != oldValue) {
      arr.forEach(function (fn) {
        fn.call(target, value, oldValue);
      });
    }
    return result;
  }
});

function util_watchAll(items, func, me, cb) {
  const marker = new Map();
  items.map(item => {
    marker.set(item, undefined);
    func(item, (after, before) => {
      if (me) {
        me.util.log.debug(`[watch] ${item} is changed from ${before} to ${after}`);
      }
      if (before !== after) {
        marker.set(`old_${item}`, before);
        marker.set(item, after);
        cb(marker);
      }
    });
  });
}

function util_isEmpty(obj) {
  for (var prop in obj) {
    if (obj.hasOwnProperty(prop)) {
      return false;
    }
  }

  return JSON.stringify(obj) === JSON.stringify({});
}


