cm_mapToken('0xAF', 'egmLocation');

cm_watch('egmLocation', (newLocation, oldLocation) => {
  writeLog({
    content: `EGM old Location is ${oldLocation} and new location is ${newLocation}`,
    writeToScreen: true
  });

  // avoid to create web socket connection multiple time,
  // since this watch callback is triggerred anyway even if floor location is not changed
  if (previousLocation === newLocation) return;

  previousLocation = newLocation;

  if (isMock) {
    const hackMap = {
      IGT_0001: '16777216',
      IGT_0002: '16777216',
      FSA0201: '402653184',
      FSA0202: '268',
      FSA0203: '219',
      FSA0204: '216',
      FSA0205: '3', // to update
      ESA0205: '1' // to update
    };

    IGTMediaElements.bonus.subscribeIsmUpdate(hackMap[egmLocation], function (message) {
      if (message && message.ismUpdate) {
        writeLog({
          level: 'debug',
          content: `[ismUpdate] received for EGM ${egmLocation} is ${JSON.stringify(message)}`
        });

        if (isWSConnectionReady && !isEmpty(playerId) && !isEmpty(uniqueId)) {
          const rrUpdateMessage = {};
          rrUpdateMessage.AwardEnable_XcEnable = awardEnable_xcEnable;
          rrUpdateMessage.AwardEnable_PtpEnable = awardEnable_ptpEnable;
          rrUpdateMessage.BE2_AwardEnable_XcEnable = BE2_AwardEnable_xcEnable;
          rrUpdateMessage.BE2_AwardEnable_PtpEnable = BE2_AwardEnable_ptpEnable;
          rrUpdateMessage.IsDuplicateCard = generalPTData_dupCard;
          rrUpdateMessage.sessionPointsTrigger = message.ismUpdate.sessionPointsTrigger;
          rrUpdateMessage.sessionPointsValue = message.ismUpdate.sessionPointsValue;
          rrUpdateMessage.playerId = playerId;
          rrUpdateMessage.egmLocation = egmLocation;
          rrUpdateMessage.cardId = cardId;
          const pad = `0000000000${uniqueId}`;
          rrUpdateMessage.EgmId = `IGT_${pad.substr(-10)}`;

          connection.send(JSON.stringify(rrUpdateMessage));
        }
      }
    });

    // initConnection('http://10.222.30.114:8177')
    // initConnection('http://10.222.31.103:8177')
    initConnection('https://randomriches.igt.com:8178');

    setupSocket();
  } else {
    IGTMediaElements.getServerAddresses(['websocket.randomriches.igt.com']).then(function (serverAddresses) {
      const h = serverAddresses['websocket.randomriches.igt.com'];

      // h = "https://randomriches.igt.com:8178"

      writeLog({
        content: `[connection] new version of server address is ${h}`,
        writeToScreen: true
      });

      if (h && h !== 'UNKNOWN') {
        // IGTMediaElements.contentCache
        //   .setStateElement('rr-isWSConfigCorrect', true, 0)
        //   .then(() => {})
        initConnection(h);
        setupSocket();
      } else {
        writeLog({
          content: '[connection] websocket.randomriches.igt.com is not set properly',
          writeToScreen: true
        });
      }
    });
  }
});

function isEmpty(data) {
  return data === '' || data === 0 || data === '0' || data === null;
}

util_watchAll(['playerId', 'cardId'], cm_watch, IGTMediaElements, data => {
  playerId = data.get('playerId');
  cardId = data.get('cardId');

  if (isEmpty(playerId) && !isEmpty(data.get('old_playerId'))) {
    // && isEmpty(cardId) && !isEmpty(data.get('old_cardId')) //cardid issue here
    awardEnable_xcEnable = false;
    awardEnable_ptpEnable = false;
    BE2_AwardEnable_xcEnable = false;
    BE2_AwardEnable_ptpEnable = false;
    generalPTData_dupCard = false;

    writeLog({
      content: `[card] [out] new playerId ${playerId} old playerId ${data.get('old_playerId')} new cardid ${cardId} old cardid ${data.get('old_cardId')}`
    });

    // IGTMediaElements.bonus.unsubscribeIsmUpdate() // do i need to call it? how to use it?
  } else if (!isEmpty(playerId)) {
    // && !isEmpty(cardId) //cardid issue here
    IGTMediaElements.contentCache.deleteStateElement('rr-progressMeter');

    writeLog({
      content: `[card] [in] playerId ${playerId} cardid ${cardId}`
    });
  } else {
    writeLog({
      level: 'debug',
      content: `[card] new playerId ${playerId} old playerId ${data.get('old_playerId')} new cardid ${cardId} old cardid ${data.get('old_cardId')}`
    });
  }
});

